import React, { useState } from "react";

const Contact = () =>{
    const [inputs, Getdata]=useState({
        name:"",
        mob:"",
        mail:"",
        message:"",
    });
    
    
    return(
        <>
            <div className="container">
                <div className="row">
                <center><h2>Contact Us</h2></center>
                    <div className="col-md-4 mx-auto">
                        <form>
                            <input type="text" placeholder="Enter Name" name="name" class="form-control"/>
                            <br/>
                            <input type="text" placeholder="Enter Mob" name="mob" class="form-control"/>
                            <br/>
                            <input type="text" placeholder="Enter mail" name="mail" class="form-control"/>
                            <br/>
                            <textarea className=" form-control" name="message" placeholder="Enter Message" row="2"/>
                            <br/>
                            <button className="btn btn-success">Submit</button>
                        </form>
                    </div>
                </div>
            </div>

        </>
    );
}


export default Contact;
